If you want to calculate the CRC of a binary number (let's say a 16-bit number for example), you would first need to convert that number into a binary data stream. Here's a simple example in Python:

```python
def crc16(data, poly=0x1021):
    crc = 0xFFFF
    for bit in data:
        crc ^= bit << 8
        for i in range(8):
            if crc & 0x8000:
                crc <<= 1 ^ poly
            else:
                crc <<= 1
    return crc & 0xFFFF

